'''Dirk J. Debbink''' is a retired [[Vice admiral (United States)|Vice Admiral]] in the [[United States Navy]] and former Chief of the Navy Reserve.
==Biography== A native of [[Oconomowoc, Wisconsin]], Debbink holds a [[bachelor's degree]] from the [[United States Naval Academy]] and an [[MBA]] from the [[University of Chicago Booth School of Business]].<ref>http://www.navy.mil/navydata/bios/navybio.asp?bioID=91</ref> He is also a registered professional engineer in [[Wisconsin]].
==Career== Debbink graduated from the [[United States Naval Academy]] in 1977 and was assigned to the [[USS Fanning (FF-1076)]]. Later assignments include serving aboard the [[USS Dale (DLG-19)]] and as Reserve Deputy Commander and Chief of Staff of the [[United States Pacific Fleet]]. He was named Deputy Chief of the Navy Reserve in 2007 before being named Chief of Navy Reserve the next year.
Awards he has received include the [[Defense Superior Service Medal]], [[Legion of Merit]] with [[award star]], the [[Defense Meritorious Service Medal]], the [[Meritorious Service Medal (United States)|Meritorious Service Medal]] with award star, the [[Navy and Marine Corps Commendation Medal]] with award star, and the [[Navy Achievement Medal]].
